const logobase64 = "data:image/png;base64, ";

img = new Image();
img.className="garagelogo"
img.src = logobase64;
document.body.append(img);
document.body.insertAdjacentHTML("afterend", 
    '<div class="garageinformation">' +
    '   <div class="garagebd">' +
    '       <span class="now"><span class="info">Now:</span> <span class="content">The ipsumsums (0:52 / 1:00)</span></span>' +
    '       <span class="next"><span class="info">Next:</span> <span class="content">Lorems!</span></span>' +
    '   </div>' +
    '</div>' + 
    '<iframe src="http://localhost:5000/app/messageframe/" allowtransparency="true" style="position: fixed;right: 0;bottom: 0;width: 50vw;height: 120px;z-index: 2000;"></iframe>');

var currentGarageIndexItem = 0;

setInterval(() => {
    var queItems = getAllQueItems();
    var startIndex = getCurrentSongIndex(queItems);
    if (startIndex === -1) {
        startIndex = currentGarageIndexItem;
    } else {
        currentGarageIndexItem = startIndex;
    }
    document.querySelector('.garageinformation .now .content').innerHTML = 
        getContentFromIndex(startIndex, queItems) + 
        ' (' +
        document.querySelector('ytmusic-player-bar .time-info').innerHTML + ')'
        ;
    document.querySelector('.garageinformation .next .content').innerHTML = getContentFromIndex(startIndex + 1, queItems);
}, 500);

function getContentFromIndex(index, queItems) {
    if (queItems.length < index) {
        return 'Unknown';
    }
    const title = queItems[index].querySelector('.song-title').innerHTML;
    const artist = queItems[index].querySelector('.song-info .byline').innerHTML;
    
    return artist + ' - ' + title;
}

function getCurrentSongIndex(queItems) {
    let retItem = -1;
    let counter = 0;
    queItems.forEach(x => {
        const state = x.querySelector('ytmusic-item-thumbnail-overlay-renderer').attributes['play-button-state'].value;
        if (state === 'playing') {
            retItem = counter;
        }
        counter++;
    });
    return retItem;
}

function getAllQueItems() {
    return document.querySelector('ytmusic-player-queue.queue').querySelectorAll('#contents > .ytmusic-player-queue');
}